import React from "react"
import s from "./Input.module.css"

const Input = (props) => {
    let refItem = React.createRef();
    let newItem = () => {
        let text = refItem.current.value;
        props.add(text);
    }
    return (
        <div className={s.input}>
            <input ref={refItem}/>
            <button className={s.button} onClick={newItem}/>
        </div>
    )
}
export default Input;
